INSERT INTO `item_itemdesc` (`id`, `item_id`, `desc`) VALUES
(3, 1, 'Sweet soft premium chocolate met heavy cocoa powder.'),
(4, 1, 'The bloom of bitter taste and aroma of layers！'),
(2, 1, '入口时，便在味蕾与身体之间纠缠不已，让原本就爱吃巧克力的你—爱不释手！ '),
(1, 1, '香软的特级巧克力遇上厚重的可可粉，其苦味所绽放出来的层层口感与香气。'),
(8, 2, 'The original European process bring you delicate taste of cheese cake.'),
(9, 2, 'With delicious cream and fresh tropical fruit, not greasy.'),
(7, 2, '原汁原味的欧式工艺，给你香醇自然的奶酪之旅......'),
(5, 2, '奶酪的口感爽滑细腻..'),
(6, 2, '搭配着香醇的淡奶油和爽口的热带果肉，没有一丝甜腻'),
(13, 3, 'Clear and attractive blueberry sauce mixed mellow cheese mou'),
(14, 3, 'light frankincense with hints of sweet and sour fruit, life should be like quiet and beautiful ...'),
(11, 3, '淡淡的乳香中透出丝丝酸甜的果味'),
(10, 3, '清透诱人的蓝莓酱混合醇厚的乳酪慕斯'),
(12, 3, '生活就该这样安宁及美丽......'),
(18, 4, 'Pure French cheese mixed fresh orange juice, with a slightly bitter cocoa powder.'),
(19, 4, 'So rich and elegant perfect fusion between, smooth fruit gel will make you enjoy.'),
(17, 4, '柔滑间果粒丁的滋味给传统味蕾不一样的轻松享受。'),
(16, 4, '浓郁与淡雅完美融合'),
(15, 4, '纯正的法国乳酪融合芳香四溢的鲜橙汁，再配上略苦的可可粉。'),
(24, 5, 'and you feel the strong taste of coffee; cheese, fried bitter coffee, wine is sweet, interwoven with unforgettable exclusive taste'),
(23, 5, 'Classic tiramisu must contain mascarpone cheese, with the charming Portugal wine'),
(25, 5, 'let a person cannot help but remember that constant ancient oath: spread take me away!'),
(21, 5, '入口时，奶酪的香滑、咖啡的苦涩、红酒的甘甜，交织成馥郁难忘的专属味道'),
(20, 5, '细腻的马斯卡布尼奶酪，混合了硬朗的意式咖啡, 再加上迷人的波特山地红酒'),
(22, 5, '让人不由得想起那个恒古流传的誓言：带我走!'),
(29, 6, '立即感受到生命中洋溢的蓬勃生机'),
